import "./App.css";
import Subject from "./Components/Subject.js";
import NAV from "./Components/NAV.js";
import Content from "./Components/Content.js";
import JSXPractice from "./Components/JSXPractice.js";

function App() {
  return (
    <div className="App">
      <JSXPractice></JSXPractice>
      <hr />
      <h1>안녕하세요</h1>
      {/* 컴포넌트 사용 */}
      <Subject></Subject>
      <hr />
      <NAV></NAV>
      <hr />
      <Content></Content>
    </div>
  );
}
export default App;
